class IssueList {
  int? releaseTime;
  String? type;
  int? date;
  int? publishTime;
  List<ItemList>? itemList;
  int? count;

  IssueList(
      {this.releaseTime,
      this.type,
      this.date,
      this.publishTime,
      this.itemList,
      this.count});

  IssueList.fromJson(dynamic json) {
    releaseTime = json['releaseTime'];
    type = json['type'];
    date = json['date'];
    publishTime = json['publishTime'];
    if (json['itemList'] != null) {
      itemList = [];
      json['itemList'].forEach((v) {
        itemList?.add(ItemList.fromJson(v));
      });
    }
    count = json['count'];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map['releaseTime'] = releaseTime;
    map['type'] = type;
    map['date'] = date;
    map['publishTime'] = publishTime;
    if (itemList != null) {
      map['itemList'] = itemList?.map((v) => v.toJson()).toList();
    }
    map['count'] = count;
    return map;
  }
